import React from 'react'
import styled from 'styled-components'

const Regional = ({CountryName}) => {
    return (
      <RegionContainer>
          <div className="Regional-tab">

          </div>
          <div className="Blob">
              <div></div>
          </div>
          <div className="Donut-Graph">

          </div>
      </RegionContainer>
    )
}

export default Regional

const RegionContainer = styled.div`
display : grid;
width:100%;
height : 100%;
grid-template-rows: 3fr 2fr;
grid-auto-columns:1fr 1fr;
grid-gap : 0.5rem;
justify-content : space-space-around;
& > div
{
    border-radius : 0.5rem;
    padding : 20px;
}
.Blob{
    background:pink;
    grid-row : 2/3;
    grid-column : 1/2;
    width: 100%;
    height:100%;
}
.Donut-Graph{
    background : whitesmoke;
    grid-row : 2/3;
    grid-column : 2/3;
    width: 100%;
    height:100%;
}
.Regional-tab{
    background : purple;
    grid-row : 1/2;
    grid-column : 1/3;
    width: 100%;
    height:100%;
}`
